        "text" : "- \u041F\u043E\u0434\u043E\u0431\u0440\u0430\u0442\u044C \u0432\u0435\u0440\u043D\u0443\u044E \u043A\u043E\u043C\u0431\u0438\u043D\u0430\u0446\u0438\u044E \u0442\u0435\u043C\u044B \u0438 \u043F\u043B\u0430\u0433\u0438\u043D\u043E\u0432, \u043F\u043E\u0437\u0432\u043E\u043B\u044F\u044E\u0449\u0443\u044E \u0440\u0435\u0430\u043B\u0438\u0437\u043E\u0432\u0430\u0442\u044C \u043F\u043E\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u043D\u044B\u0435 \u0446\u0435\u043B\u0438.\\n- \u041F\u0440\u043E\u0440\u0430\u0431\u043E\u0442\u0430\u0442\u044C \u0441\u0442\u0440\u0443\u043A\u0442\u0443\u0440\u0443 \u0440\u0443\u0431\u0440\u0438\u043A \u0438 \u043C\u0435\u0442\u043E\u043A \u0437\u0430\u043F\u0438\u0441\u0435\u0439\\n- \u041F\u0440\u043E\u0434\u0443\u043C\u0430\u0442\u044C \u043E\u0444\u043E\u0440\u043C\u043B\u0435\u043D\u0438\u0435 \u043C\u0435\u043D\u044E \u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u044D\u043B\u0435\u043C\u0435\u043D\u0442\u043E\u0432 \u0434\u0438\u0437\u0430\u0439\u043D\u0430\\n- \u0421\u043E\u0437\u0434\u0430\u0442\u044C \u0432\u0441\u0435 \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u044B\u0435 \u0441\u0442\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0441\u0442\u0440\u0430\u043D\u0438\u0446\u044B\\n- \u041F\u043E\u0434\u043A\u043B\u044E\u0447\u0438\u0442\u044C \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0439 \u0444\u0443\u043D\u043A\u0446\u0438\u043E\u043D\u0430\u043B \u0441 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C\u044E \u043B\u043E\u0433\u0438\u043D\u0430 \u0447\u0435\u0440\u0435\u0437 \u0441\u043E\u0446. \u0441\u0435\u0442\u0438",
